        /// <summary>
        /// Writes the VGA Registers.
        /// </summary>
        /// <param name="registers"></param>
        private static void WriteVGARegisters(byte[] registers)
        {
            int xIdx = 0;
            byte i;
            /* write MISCELLANEOUS reg */
            mIO.MiscellaneousOutput_Write.Byte = registers[xIdx];
            xIdx++;
            /* write SEQUENCER regs */
            for (i = 0; i < NumSeqRegs; i++)
            {
                mIO.Sequencer_Index.Byte = i;
                mIO.Sequencer_Data.Byte = registers[xIdx];
                xIdx++;
            }
            /* unlock CRTC registers */
            mIO.CRTController_Index.Byte = 0x03;
            mIO.CRTController_Data.Byte= (byte)(mIO.CRTController_Data.Byte | 0x80);
            mIO.CRTController_Index.Byte = 0x11;
            mIO.CRTController_Data.Byte= (byte)(mIO.CRTController_Data.Byte & 0x7F);
            /* make sure they remain unlocked */
            unchecked
            {
                registers[0x03] |= 0x80;
                registers[0x11] &= 0x7f;
            }
            /* write CRTC regs */
            for (i = 0; i < NumCRTCRegs; i++)
            {
                mIO.CRTController_Index.Byte = i;
                mIO.CRTController_Data.Byte = registers[xIdx];
                xIdx++;
            }
            /* write GRAPHICS CONTROLLER regs */
            for (i = 0; i < NumGCRegs; i++)
            {
                mIO.GraphicsController_Index.Byte=i;
                mIO.GraphicsController_Data.Byte = registers[xIdx];
                xIdx++;
            }
            /* write ATTRIBUTE CONTROLLER regs */
            for (i = 0; i < NumACRegs; i++)
            {
                var xDoSomething = mIO.Instat_Read.Byte;
                mIO.AttributeController_Index.Byte=i;
                mIO.AttributeController_Write.Byte=registers[xIdx];
                xIdx++;
            }
            /* lock 16-color palette and unblank display */
            var xNothing =mIO.Instat_Read.Byte;
            mIO.AttributeController_Index.Byte=0x20;
        }
        /// <summary>
        /// Sets a VGA Plane.
        /// </summary>
        /// <param name="p"></param>
        private static void SetPlane(byte p)
        {
            byte pmask;
            p &= 3;
            pmask = (byte)(1 << p);
            /* set read plane */
            mIO.GraphicsController_Index.Byte = 4;
            mIO.GraphicsController_Data.Byte = p;
            /* set write plane */
            mIO.Sequencer_Index.Byte = 2;
            mIO.Sequencer_Data.Byte = pmask;
        }
        /// <summary>
        /// Gets the Frame Buffer Segment.
        /// </summary>
        /// <returns></returns>
        private static MemoryBlock08 GetFramebufferSegment()
        {
            int seg;
            mIO.GraphicsController_Index.Byte = 6;
            seg = mIO.GraphicsController_Data.Byte;
            Global.Dbg.Send("VGA: raw seg value: " + seg.ToString());
            seg >>= 2;
            seg &= 3;
            switch (seg)
            {
                case 0:
                case 1:
                    return mIO.VGAMemoryBlock;
                case 2:
                    return mIO.MonochromeTextMemoryBlock;
                case 3:
                    return mIO.CGATextMemoryBlock;
            }
            throw new Exception("Unable to determine memory segment!");
        }
        /// <summary>
        /// Writes a font to memory.
        /// </summary>
        /// <param name="font"></param>
        /// <param name="font_height"></param>
        private static void WriteFont(byte[] font, byte font_height)
        {
            byte seq2, seq4, gc4, gc5, gc6;
            /* save registers
                set_plane() modifies GC 4 and SEQ 2, so save them as well */
            mIO.Sequencer_Index.Byte = 2;
            seq2 = mIO.Sequencer_Data.Byte;
            mIO.Sequencer_Index.Byte = 4;
            seq4 = mIO.Sequencer_Data.Byte;
            /* turn off even-odd addressing (set flat addressing)
            assume: chain-4 addressing already off */
            mIO.Sequencer_Data.Byte = (byte)(seq4 | 0x04);
            mIO.GraphicsController_Index.Byte = 4;
            gc4 = mIO.GraphicsController_Data.Byte;
            mIO.GraphicsController_Index.Byte = 5;
            gc5 = mIO.GraphicsController_Data.Byte;
            /* turn off even-odd addressing */
            mIO.GraphicsController_Data.Byte = (byte)(gc5 & ~0x10);
            mIO.GraphicsController_Index.Byte = 6;
            gc6 = mIO.GraphicsController_Data.Byte;
            /* turn off even-odd addressing */
            mIO.GraphicsController_Data.Byte = (byte)(gc6 & ~0x02);
            /* write font to plane P4 */
            SetPlane(2);
            /* write font 0 */
            var seg = GetFramebufferSegment();
            for (uint i = 0; i < 256; i++)
            {
                for (uint j = 0; j < font_height; j++)
                {
                    seg[(i * 32) + j] = font[(i * font_height) + j];
                }
            }
            /* restore registers */
            mIO.Sequencer_Index.Byte = 2;
            mIO.Sequencer_Data.Byte = seq2;
            mIO.Sequencer_Index.Byte = 4;
            mIO.Sequencer_Data.Byte = seq4;
            mIO.GraphicsController_Index.Byte = 4;
            mIO.GraphicsController_Data.Byte = gc4;
            mIO.GraphicsController_Index.Byte = 5;
            mIO.GraphicsController_Data.Byte = gc5;
            mIO.GraphicsController_Index.Byte = 6;
            mIO.GraphicsController_Data.Byte = gc6;
        }
        /// <summary>
        /// Available text sizes.
        /// </summary>
        public enum TextSize { Size40x25, Size40x50, Size80x25, Size80x50, Size90x30, Size90x60 };
        /// <summary>
        /// Switches to Text Mode.
        /// </summary>
        /// <param name="aSize"></param>
        public static void SetTextMode(TextSize aSize)
        {
            switch (aSize)
            {
                case TextSize.Size40x25:
                    WriteVGARegisters(g_40x25_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size40x50:
                    WriteVGARegisters(g_40x50_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                case TextSize.Size80x25:
                    WriteVGARegisters(g_80x25_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size80x50:
                    WriteVGARegisters(g_80x50_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                case TextSize.Size90x30:
                    WriteVGARegisters(g_90x30_text);
                    WriteFont(g_8x16_font, 16);
                    break;
                case TextSize.Size90x60:
                    WriteVGARegisters(g_90x60_text);
                    WriteFont(g_8x8_font, 8);
                    break;
                default:
                    throw new Exception("Invalid text size.");
            }
        }
        /// <summary>
        /// Sets the Standard VGA Mode.
        /// </summary>
        public static void SetMode(ScreenResolution res)
        {
            switch (res)
            {
                case ScreenResolution.Res320x200x4:
                    WriteVGARegisters(g_320x200x4);
                    ScreenWidth = 320;
                    ScreenHeight = 200;
                    Colors = 4;
                    break;
                case ScreenResolution.Res320x200x256:
                    WriteVGARegisters(g_320x200x256);
                    ScreenWidth = 320;
                    ScreenHeight = 200;
                    Colors = 256;
                    break;
                case ScreenResolution.Res640x480x2:
                    WriteVGARegisters(g_640x480x2);
                    ScreenWidth = 640;
                    ScreenHeight = 480;
                    Colors = 2;
                    break;
                case ScreenResolution.Res640x480x16:
                    WriteVGARegisters(g_640x480x16);
                    ScreenWidth = 640;
                    ScreenHeight = 480;
                    Colors = 16;
                    break;
                case ScreenResolution.Res720x480x16:
                    WriteVGARegisters(g_720x480x16);
                    ScreenWidth = 720;
                    ScreenHeight = 480;
                    Colors = 16;
                    break;
            }
            //Clear out all of our previous pallette entrys if any.
            VGAColors.ClearEntrys();
            //Now add in our colors based on resolution.
            if (res == ScreenResolution.Res320x200x256)
            {
                //Set all of our needed colors for our 256 colors.
                //These are contain the basics, and the advanced, use them.
                VGAColors.AddEntry(240, 248, 255);
                VGAColors.AddEntry(250, 235, 215);
                VGAColors.AddEntry(0, 255, 255);
                VGAColors.AddEntry(127, 255, 212);
                VGAColors.AddEntry(240, 255, 255);
                VGAColors.AddEntry(245, 245, 220);
                VGAColors.AddEntry(255, 228, 196);
                VGAColors.AddEntry(0, 0, 0);
                VGAColors.AddEntry(255, 235, 205);
                VGAColors.AddEntry(0, 0, 255);
                VGAColors.AddEntry(138, 43, 226);
                VGAColors.AddEntry(165, 42, 42);
                VGAColors.AddEntry(222, 184, 135);
                VGAColors.AddEntry(95, 158, 160);
                VGAColors.AddEntry(127, 255, 0);
                VGAColors.AddEntry(210, 105, 30);
                VGAColors.AddEntry(255, 127, 80);
                VGAColors.AddEntry(100, 149, 237);
                VGAColors.AddEntry(255, 248, 220);
                VGAColors.AddEntry(220, 20, 60);
                VGAColors.AddEntry(0, 255, 255);
                VGAColors.AddEntry(0, 0, 139);
                VGAColors.AddEntry(0, 139, 139);
                VGAColors.AddEntry(184, 134, 11);
                VGAColors.AddEntry(169, 169, 169);
                VGAColors.AddEntry(0, 100, 0);
                VGAColors.AddEntry(189, 183, 107);
                VGAColors.AddEntry(139, 0, 139);
                VGAColors.AddEntry(85, 107, 47);
                VGAColors.AddEntry(255, 140, 0);
                VGAColors.AddEntry(153, 50, 204);
                VGAColors.AddEntry(139, 0, 0);
                VGAColors.AddEntry(233, 150, 122);
                VGAColors.AddEntry(143, 188, 143);
                VGAColors.AddEntry(72, 61, 139);
                VGAColors.AddEntry(47, 79, 79);
                VGAColors.AddEntry(0, 206, 209);
                VGAColors.AddEntry(148, 0, 211);
                VGAColors.AddEntry(255, 20, 147);
                VGAColors.AddEntry(0, 191, 255);
                VGAColors.AddEntry(105, 105, 105);
                VGAColors.AddEntry(30, 144, 255);
                VGAColors.AddEntry(178, 34, 34);
                VGAColors.AddEntry(255, 250, 240);
                VGAColors.AddEntry(34, 139, 34);
                VGAColors.AddEntry(255, 0, 255);
                VGAColors.AddEntry(220, 220, 220);
                VGAColors.AddEntry(248, 248, 255);
                VGAColors.AddEntry(255, 215, 0);
                VGAColors.AddEntry(218, 165, 32);
                VGAColors.AddEntry(128, 128, 128);
                VGAColors.AddEntry(0, 128, 0);
                VGAColors.AddEntry(173, 255, 47);
                VGAColors.AddEntry(240, 255, 240);
                VGAColors.AddEntry(255, 105, 180);
                VGAColors.AddEntry(205, 92, 92);
                VGAColors.AddEntry(75, 0, 130);
                VGAColors.AddEntry(255, 255, 240);
                VGAColors.AddEntry(240, 230, 140);
                VGAColors.AddEntry(230, 230, 250);
                VGAColors.AddEntry(255, 240, 245);
                VGAColors.AddEntry(124, 252, 0);
                VGAColors.AddEntry(255, 250, 205); //LemonChiffon
            }
            else if (res == ScreenResolution.Res640x480x16 || res == ScreenResolution.Res720x480x16)
            {
                //Set our 16 colors. Now since we only have 16 colors, lets
                //add the most common ones.
                VGAColors.AddEntry(0, 255, 255);
                VGAColors.AddEntry(0, 0, 0);
                VGAColors.AddEntry(0, 0, 255);
                VGAColors.AddEntry(255, 0, 255);
                VGAColors.AddEntry(128, 128, 128);
                VGAColors.AddEntry(0, 128, 0);
                VGAColors.AddEntry(0, 255, 0);
                VGAColors.AddEntry(128, 0, 0);
                VGAColors.AddEntry(0, 0, 128);
                VGAColors.AddEntry(128, 128, 0);
                VGAColors.AddEntry(128, 0, 128);
                VGAColors.AddEntry(255, 0, 0);
                VGAColors.AddEntry(192, 192, 192);
                VGAColors.AddEntry(0, 128, 128);
                VGAColors.AddEntry(255, 255, 255);
                VGAColors.AddEntry(255, 255, 0);
            }
            //No matter what Resolution, still set all the colors in the entrys.
            for (int i = 0; i < VGAColors.PalletteEntrys.Count; i++)
            {
                SetPaletteEntry(VGAColors.PalletteEntrys[i].Index, VGAColors.PalletteEntrys[i]);
            }
            //Now set the current screen resolution, so we can start
            //calling our SetPixel function.
            CurrentResolution = res;
            //Now lets clear the screen to black, since 16 colors or 256 colors, they all contain black.
            Clear(VGAColors.FindIndex(0, 0, 0));
            //Now draw our test square.
            if (GetPixel(1, 1) == VGAColors.FindIndex(0, 0, 0))
            {
                int c = VGAColors.FindIndex(255, 0, 0);
                for (uint y = 8; y < ScreenHeight - 8; y++)
                {
                    for (uint x = 8; x < ScreenWidth - 8; x++)
                    {
                        SetPixel(x, y, (uint)c);
                    }
                }
            }
        }
        /// <summary>
        /// Clears the Screen. Works for any mode.
        /// </summary>
        /// <param name="color"></param>
        public static void Clear(int color)
        {
            for (uint y = 0; y < ScreenHeight; y++)
            {
                for (uint x = 0; x < ScreenWidth; x++)
                {
                    SetPixel(x, y, (uint)color);
                }
            }
        }
        /// <summary>
        /// Sets a pixel, it will find the propper method
        /// for you video mode, dont worry.
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <param name="c"></param>
        public static void SetPixel(uint x, uint y, uint c)
        {
            if (CurrentResolution == ScreenResolution.Res320x200x256)
            {
                SetPixel_8(x, y, c);
            }
            else if (CurrentResolution == ScreenResolution.Res320x200x4)
            {
                SetPixel_2(x, y, c);
            }
            else if (CurrentResolution == ScreenResolution.Res640x480x16 || CurrentResolution == ScreenResolution.Res640x480x2 || CurrentResolution == ScreenResolution.Res720x480x16)
            {
                SetPixel_4(x, y, c);
            }
        }
        /// <summary>
        /// Sets a pixel, used for 320x200x4
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <param name="c"></param>
        private static void SetPixel_2(uint x, uint y, uint c)
        {
            c = (c & 3) * 0x55;
            uint wd_in_bytes = (uint)ScreenWidth / 4;
            uint off = wd_in_bytes * y + x / 4;
            x = (x & 3) * 2;
            byte mask = (byte)(0xC0 >> (int)x);
            mIO.VGAMemoryBlock[off] = (byte)((mIO.VGAMemoryBlock[off] & ~mask) | (c & mask));
        }
        /// <summary>
        /// Sets a pixel, used for 320x200x256
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <param name="c"></param>
        private static void SetPixel_8(uint x, uint y, uint c)
        {
            mIO.VGAMemoryBlock[(y * 320) + x] = (byte)(c & 0xFF);
        }
        /// <summary>
        /// Seta a pixel, used for 640x480 and 720x480.
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <param name="c"></param>
        private static void SetPixel_4(uint x, uint y, uint c)
        {
            uint wd_in_bytes = (uint)ScreenWidth / 8;
            uint off = wd_in_bytes * y + x / 8;
            x = (x & 7) * 1;
            byte mask = (byte)(0x80 >> (int)x);
            uint pmask = 1;
            for (byte p = 0; p < 4; p++)
            {
                SetPlane(p);
                if (pmask == 1 && c == 1) {
                    mIO.VGAMemoryBlock[off] = (byte)(mIO.VGAMemoryBlock[off] | mask);
                }
                else {
                    mIO.VGAMemoryBlock[off] = (byte)(mIO.VGAMemoryBlock[off] & ~mask);
                }
                pmask <<= 1;
            }
        }
        /// <summary>
        /// Gets a pixel.
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <returns></returns>
        public static uint GetPixel(uint x, uint y)
        {
            if (CurrentResolution == ScreenResolution.Res320x200x256)
            {
                return GetPixel_8(x, y);
            }
            else if (CurrentResolution == ScreenResolution.Res640x480x16 || CurrentResolution == ScreenResolution.Res640x480x2 || CurrentResolution == ScreenResolution.Res720x480x16)
            {
                return GetPixel_4(x, y);
            }
            else
            {
                return 0;
            }
        }
        /// <summary>
        /// Gets a pixel, used for 640x480 and 720x480.
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <returns></returns>
        private static uint GetPixel_4(uint x, uint y)
        {
            uint wd_in_bytes = (uint)ScreenWidth / 8;
            uint off = wd_in_bytes * y + x / 8;
            uint pmask = 1;
            uint palletteid = 0;
            for (byte p = 0; p < 4; p++)
            {
                SetPlane(p);
                if (mIO.VGAMemoryBlock[off] == 255)
                {
                    palletteid += pmask;
                }
                pmask <<= 1;
            }
            return palletteid;
        }
        /// <summary>
        /// Gets a pixel, used for 320x200x256
        /// </summary>
        /// <param name="x"></param>
        /// <param name="y"></param>
        /// <returns></returns>
        private static uint GetPixel_8(uint x, uint y)
        {
            return mIO.VGAMemoryBlock[(y * 320) + x];
        }
        /// <summary>
        /// Sets a Pallette Entry.
        /// </summary>
        /// <param name="index"></param>
        /// <param name="color"></param>
        public static void SetPaletteEntry(int index, Color color)
        {
            SetPaletteEntry(index, color.Red, color.Green, color.Blue);
        }
        /// <summary>
        /// Sets a Pallette
        /// </summary>
        /// <param name="index"></param>
        /// <param name="pallete"></param>
        public static void SetPalette(int index, byte[] pallete)
        {
            mIO.DACIndex_Write.Byte=(byte)index;
            for (int i = 0; i < pallete.Length; i++)            
                mIO.DAC_Data.Byte = (byte)(pallete[i] >> 2);            
        }
        /// <summary>
        /// Sets a Pallette Entry.
        /// </summary>
        /// <param name="index"></param>
        /// <param name="r"></param>
        /// <param name="g"></param>
        /// <param name="b"></param>
        public static void SetPaletteEntry(int index, byte r, byte g, byte b)
        {
            mIO.DACIndex_Write.Byte = (byte)index;
            mIO.DAC_Data.Byte = (byte)(r >> 2);
            mIO.DAC_Data.Byte = (byte)(g >> 2);
            mIO.DAC_Data.Byte = (byte)(b >> 2);
        }
